import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { getBrands, getCategories } from "../../services/productService";
import './css/HomeStyles.css'; // CSS

const Home = () => {
    const [brands, setBrands] = useState([]);
    const [categories, setCategories] = useState([]);
    const [searchQuery, setSearchQuery] = useState("");
    const [selectedBrand, setSelectedBrand] = useState("");
    const [selectedCategory, setSelectedCategory] = useState("");
    const [priceRange, setPriceRange] = useState("");

    const navigate = useNavigate();

    // Lấy brands và categories
    useEffect(() => {
        const fetchBrands = async () => {
            const data = await getBrands();
            setBrands(data);
        };

        const fetchCategories = async () => {
            const data = await getCategories();
            setCategories(data);
        };

        fetchBrands();
        fetchCategories();
    }, []);

    // Thêm sản phẩm vào giỏ hàng
    const addToCart = (product) => {
        const token = localStorage.getItem("token");
        const userId = localStorage.getItem("userId");

        if (!token || !userId) {
            alert("⚠ Bạn cần đăng nhập để thêm sản phẩm vào giỏ hàng.");
            navigate("/login");
            return;
        }

        const cartKey = `cart_${userId}`;
        const cart = JSON.parse(localStorage.getItem(cartKey)) || [];
        const existingIndex = cart.findIndex(item => item._id === product._id);

        if (existingIndex !== -1) {
            cart[existingIndex].quantity += 1;
        } else {
            cart.push({ ...product, quantity: 1 });
        }

        localStorage.setItem(cartKey, JSON.stringify(cart));
        alert("🛒 Sản phẩm đã được thêm vào giỏ hàng!");
    };

    // Xử lý lọc và điều hướng khi nhấn "Tìm kiếm"
    const handleSearch = () => {
        let min = "";
        let max = "";

        if (priceRange === "0-500000") {
            min = 0;
            max = 500000;
        } else if (priceRange === "500000-1000000") {
            min = 500000;
            max = 1000000;
        }

        const filters = {};

        if (searchQuery.trim() !== "") filters.name = searchQuery.trim();
        if (selectedBrand !== "") filters.brand = selectedBrand;
        if (selectedCategory !== "") filters.category = selectedCategory;
        if (min !== "" && max !== "") {
            filters.minPrice = min;
            filters.maxPrice = max;
        }

        // Điều hướng sang trang kết quả với filters
        navigate("/search", { state: filters });
    };

    return (
        <div>
            <h2>Danh sách sản phẩm</h2>

            {/* Tìm kiếm và bộ lọc */}
            <div className="search-container">
                <input
                    type="text"
                    placeholder="Tìm kiếm theo tên sản phẩm..."
                    value={searchQuery}
                    onChange={(e) => setSearchQuery(e.target.value)}
                />
                <select onChange={(e) => setSelectedBrand(e.target.value)} value={selectedBrand}>
                    <option value="">Chọn Thương Hiệu</option>
                    {brands.map((brand) => (
                        <option key={brand._id} value={brand._id}>
                            {brand.name}
                        </option>
                    ))}
                </select>
                <select onChange={(e) => setSelectedCategory(e.target.value)} value={selectedCategory}>
                    <option value="">Chọn Loại</option>
                    {categories.map((category) => (
                        <option key={category._id} value={category._id}>
                            {category.name}
                        </option>
                    ))}
                </select>
                <select onChange={(e) => setPriceRange(e.target.value)} value={priceRange}>
                    <option value="">Chọn khoảng giá</option>
                    <option value="0-500000">0 - 500.000 VNĐ</option>
                    <option value="500000-1000000">500.000 - 1.000.000 VNĐ</option>
                </select>
                <button onClick={handleSearch}>Tìm kiếm</button>
            </div>

            {/* Có thể hiển thị thêm sản phẩm nổi bật, hoặc sản phẩm mới ở đây */}
        </div>
    );
};

export default Home;
